const { ObjectId } = require('mongodb');
const mongoose = require('mongoose')
const passportLocalMongoose= require('passport-local-mongoose')

var photo = 'data:image/jpeg;base64,'

var backgroundPhoto = 'data:image/jpeg;base64,'

const UserSchema = mongoose.Schema({
    profileName: {type: String, required: true, unique: true,lowercase: true},
    username: {type: String, required: true, unique: true,lowercase: true},
    password: {type: String},
    profilePhoto: {type: String, default:photo},
    backgroundProfilePhoto: {type: String, default:backgroundPhoto},
    role: {type: Number, default: 0},
    accountType: {type: String, default: 'private'},
    blogsIds: [{type: ObjectId}]
},
{timestamps:true},
);

UserSchema.plugin(passportLocalMongoose);

const UserModel = mongoose.model('userDetail', UserSchema);
module.exports = UserModel;